con:config.script:
import com.eviware.soapui.support.GroovyUtils
import groovy.xml.XmlUtil
import javax.xml.XMLConstants
import javax.xml.transform.stream.StreamSource
import javax.xml.validation.SchemaFactory

def groovyUtils = new com.eviware.soapui.support.GroovyUtils(context)

def projectDir = groovyUtils.projectPath
def output_path = testRunner.testCase.testSuite.project.getPropertyValue( "output_path" ) // 'C:\\output'
def output_prefix = testRunner.testCase.testSuite.project.getPropertyValue( "output_prefix" )

def batchId = testRunner.testCase.getPropertyValue('batchId')
def output_filepattern = "${output_prefix}-${batchId}.*\\.xml"

def XSDpath = projectDir + '\\..\\..\\..\\..\\reimbursement-schemas\\src\\main\\xsd\\HEJIndata'

// Load last created file
def filelist = new File(output_path).listFiles()

log.info filelist.toList()

def lastModified = 0
def output_filename = ""

for (currentFile in filelist) { 
    if(currentFile.exists()) {
        // Check filename            
        if(currentFile.getName() ==~ ~/${output_filepattern}/) {
                // Check modification date

                if(currentFile.lastModified() > lastModified) {               
                    output_filename = currentFile    
                    lastModified = currentFile.lastModified()
                }
        }
    }
}
log.info output_filename

assert output_filename != "" : "No file was found"

def output_file = new File(output_path, output_filename.getName())

// Validate output against XSD
def xsdoutput = new File( XSDpath, 'HEJIndata2.0.xsd' ).withReader { 
            xsd ->  SchemaFactory.newInstance( XMLConstants.W3C_XML_SCHEMA_NS_URI )
                .newSchema( new StreamSource( xsd ) )
                   .newValidator()
                   .validate( new StreamSource(  output_file ) )

}

// Validate output mapping


def holder = groovyUtils.getXmlHolder( output_file.text )
//holder.declareNamespace("s", 'http://schemas.xmlsoap.org/soap/envelope/' )
//holder.declareNamespace("ns1", 'urn:riv:followup:qualityregistry:nkrr:1')
//holder.declareNamespace("ns2", 'urn:riv:followup:qualityregistry:nkrr:GetFormDataResponder:1' )

def xpath_map = testRunner.testCase.getTestStepByName( "xpath_map" );


// Map and validate output
def prop_name = ""
def prop_value = ""
def prop_xpath = ""


for(prop in xpath_map.getPropertyList()) {

    prop_name = prop.getName()
    prop_xpath = prop.getValue()    
    prop_value = context.expand(testRunner.testCase.getPropertyValue(prop_name))

    assert prop_xpath : "Missing xpath for " + prop_name
    assert prop_value : "Missing value for " + prop_name

    value = holder.getNodeValue(prop_xpath)

    log.info String.format("prop %s = %s | output = %s", prop_name, prop_value, value)     
    assert value == prop_value : String.format("prop %s = %s | output = %s", prop_name, prop_value, value)

}
